import React from "react";
import "./Header.css";

const Header = props => (
    <div className="header">
        <ul>

            <a href="html-image-hyperlink.php"><img src="../../../assets/images/banner.jpg" /></a>
            <h3>Click all the pictures without clikcing anyone more than once. </h3>

            <h3> Refresh page once finished with Game</h3>
            <li id="score">Score: {props.score} | Top Score: {props.topScore}</li>  
        </ul>

    </div>
)

export default Header;
